Step-by-step reasoning:
• The responder’s decision is assumed to rely on a fairness comparison. The participant compares the share they are offered (split_self) with what they expect to be fair given their relative contribution (calculated as token_self relative to the sum token_self + token_opp multiplied by the available combined_earning).
• The key psychological mechanism is that a proposal is more likely to be accepted if the offered share exceeds the fairness reference.
• Mathematically, we compute a fairness deviation d = split_self – (token_self/(token_self+token_opp))*combined_earning. This captures whether the offer is above or below what is considered fair.
• The utility for accepting the offer is then modeled as a linear function of this deviation with an intercept (beta0) and sensitivity (beta1). The logistic transformation converts this utility into an acceptance probability.
• The learnable parameters are beta0 (a bias/intercept term) and beta1 (a sensitivity to fairness deviation). They have generous finite bounds.
• The model variables from the dataset (split_self, combined_earning, token_self, token_opp) are used to compute d, which is then used in the logistic choice rule to predict accept.

<MODEL>
U = beta0 + beta1 * (split_self - (token_self/(token_self+token_opp))*combined_earning)
P_accept = 1/(1+exp(-U))
accept ~ Bernoulli(P_accept)
</MODEL>

